import React from 'react'

export const Profile = () => {
  return (
    <div class="intro">
        <div class="container">

            <p>I'm a multi-disciplinary frontend engineer with a passion for user-focused products. </p>
            <p>I'm a creative problem solver with a background in media production, photography, and marketing.</p>

            <div>Currently open to <span class="wavy-underline">new opportunities</span></div>
        </div>
  </div>
  )
}
